$("#generar").click(function(){

	/*Función para centrar el texto*/
	(function(API){
    API.myText = function(txt, options, x, y) {
        options = options ||{};
        if( options.align == "center" ){
            var fontSize = this.internal.getFontSize();
            var pageWidth = this.internal.pageSize.width;
            txtWidth = this.getStringUnitWidth(txt)*fontSize/this.internal.scaleFactor;
            x = ( pageWidth - txtWidth ) / 2;
        }
        this.text(txt,x,y);
    }
})(jsPDF.API);

	/*var date = new Date();
    var filename = date.getUTCDate()+date.getTime();*/

  var imgData = 'data:image/jpeg;base64,'
  var pdf = new jsPDF('p', 'mm', 'a4');
  pdf.addImage(imgData, 'JPEG', 20, 8, 20, 20)
  pdf.setFont('times')
  pdf.setFontType('bold')
  pdf.setFontSize(8)
  pdf.setTextColor(0, 0, 0)
  pdf.myText("UNIVERSIDAD DE ORIENTE",{align: "center"},0,15,);
  pdf.myText("RECTORADO",{align: "center"},0,19,);
  pdf.myText("COMISIÓN RECTORAL DE EVALUACIÓN Y DESARROLLO INSTITUCIONAL",{align: "center"},0,23,);


  pdf.myText("CUESTIONARIO DE EVALUACIÓN DEL DESEMPEÑO LABORAL",{align: "center"},0,35,);


  pdf.setFontType('normal')
  pdf.text(22, 45, 'A continuación se le presenta un cuestionario que pretende diagnosticar el desempeño laboral del personal administrativo y obrero de la ')
  pdf.text(17, 49, 'Universidad de Oriente. La escala de valoración del 1 al 5, considerando 1 como la puntuación más baja y 5 como la más alta.')


var res = pdf.autoTableHtmlToJson(document.getElementById("basic-table"));
  pdf.autoTable(res.columns, res.data, { theme: 'grid', pageBreak: 'avoid',
    tableLineColor: [0],
        tableLineWidth: 0.2,
        styles: {
            font: 'times',
            lineColor: [100],
            lineWidth: 0.1
        },
        headerStyles: {
            fillColor: [180, 226, 255],
            fontStyle: 'bold',
            textColor: 0,
            fontSize: 9
        },
        bodyStyles: {
            fillColor: [240],
            textColor: 0,
            fontSize: 8
        },
        alternateRowStyles: {
            fillColor: [255]
        },
        columnStyles: {
            email: {
                fontStyle: 'bold'
            }
        },
    margin: {top: 53, right: 15, bottom: 10, left: 15}
});

  /*pdf.save('Formato instrumento de evaluación ' + filename + '.pdf');*/

  pdf.save('CREDIUDO Instrumento de evaluación.pdf');

});









